import React from 'react';
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';
import {Grid} from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import Item from './Item.js';

const Experience = () => {
    return (
        <Grid container
        direction="row"
        justify="flex-start"
        alignItems="center"
        style={{marginLeft:'30px'}}>

            <Grid item xs={6}>
            <Typography
                display="block"
                justifyContent="center"
                align="center"
                variant="h3"
                style={{opacity:'100%', fontWeight:'bold', fontSize:'40px', color:'white', marginBottom:'20px'}}>
                    Experience
                </Typography>
            </Grid>

            <Grid item xs={6}>
                <Item 
                jobTitle='job title'
                comapny='company'
                text='sdj fajs fwoiaf ofju aweojwe sdj fajs fwoiaf ofju aweojwe sdj fajs fwoiaf ofju aweojwe 
                sdj fajs fwoiaf ofju aweojwe sdj fajs fwoiaf ofju aweojwe sdj fajs fwoiaf ofju aweojwe' />
            </Grid>

        </Grid>
    )
}

export default Experience;
